oxy_webhelp_navlinks = {"tocId-d23139e17345":{"topics":[{"title":"Prerequisites for Azure SQL MI Rubrik backup","shortdesc":"<p class=\"shortdesc\">Enabling Rubrik backups of Azure SQL Managed Instances requires specific         configuration on both <span class=\"ph\">RSC<\/span> and Azure.<\/p>","href":"saas\/azr_sql_mi_prereq_rbk_backup.html","attributes":{"data-id":"azr_sql_mi_prereq_rbk_backup"},"menu":{"hasChildren":false},"tocID":"azr_sql_mi_prereq_rbk_backup-d23139e17346","topics":[]},{"title":"Network configurations for Azure SQL MI","shortdesc":"<p class=\"shortdesc\">To back up an Azure SQL Managed Instance, you must configure a secure connection between the Rubrik Exocompute instance and the source MI. While a service endpoint is a simpler option, Rubrik primarily recommends a private endpoint, which uses a private IP address to ensure a secure, private connection that complies with strict security policies.<\/p>","href":"saas\/azr_sql_mi_nw_configs.html","attributes":{"data-id":"azr_sql_mi_nw_configs"},"menu":{"hasChildren":false},"tocID":"azr_sql_mi_nw_configs-d23139e17360","next":"azr_sql_mi_nw_configs-d23139e17360"},{"title":"Credential management for Azure SQL MI Rubrik backups","shortdesc":"<p class=\"shortdesc\">Credential management for taking Rubrik backups of Azure SQL Managed Instance         involves creating login credentials and enabling Change Data Capture. Taking Rubrik backups         of Azure SQL Managed Instance requires generating BACPAC files.<\/p>","href":"saas\/azr_sql_mi_cred_mgmt_rbk_backup.html","attributes":{"data-id":"azr_sql_mi_cred_mgmt_rbk_backup"},"menu":{"hasChildren":false},"tocID":"azr_sql_mi_cred_mgmt_rbk_backup-d23139e17400","next":"azr_sql_mi_cred_mgmt_rbk_backup-d23139e17400"}]}};